export default (function(a,b,c,d,e,f,g,h,i){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:e,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:e,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:f,pageSize:25,pageCount:f,total:5}}},QaGo7S15iU:{data:{id:2051,attributes:{imdbId:"tt0338337",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTczMzU5NDk4MV5BMl5BanBnXkFtZTYwNDQxNzc3._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"6.3\u002F10"},{Source:"Rotten Tomatoes",Value:"27%"},{Source:"Metacritic",Value:"43\u002F100"}],item_lang:{data:{id:2714,attributes:{title:g,plot:"Michael Jennings is a reverse engineer and what he does is technical jobs for certain companies and as soon as he is done, his memory of the work he has done is wiped out. Now the longest he has been contracted is 2 months. But now billionaire, James Rethrick offers him a job that would last 2 years, maybe 3, and he promises that he will probably earn 8 figures. Michael agrees. Before beginning he turns in all of his personal effects. And when the job is done, his memory is erased and he learns he made over 90 million dollars over the three years. When he goes to claim it and his personal effects, he discovers that prior to the erasure of his memory he waived his rights to the money he earned and that the items that were given to him were not the ones he gave when he began. Later he is arrested by the FBI who say that he committed some act of treason and murder. It's while he is in custody that he escapes using some the items that he was given. He later meets with a friend who gives him some information that helps him understand what is going on. And at the same time Rethrick for some reason wants him so he is being pursued by Rethrick's people.",slug:"paycheck"}}},books:{data:[{id:10204,attributes:{title:g,description:"PAYCHECK, originally written as a short story by Philip K. Dick and first published in 1953, centres on an electrician who wakes up to discover his employer has erased his memory of the past two years -- as a security measure. When he tries to collect his paycheck, he finds he has previously signed a release replacing the money with a bag of random objects. Previous film adaptations of Dick's short stories have included the box office smash hits MINORITY REPORT, TOTAL RECALL and BLADE RUNNER, released shortly after Dick died in 1982.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=zaFZCSb5CpgC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:true,published:"2010-05-14",publisher:"Hachette UK",subtitle:c}},{id:10205,attributes:{title:"Paycheck and Other Classic Stories",description:"The earliest short and medium-length fiction by Philip K. Dick (including several previously unpublished stories) during the years 1952-1955 is contained in this collection of science fiction stories. In addition to the title story, the volume includes Beyond Lies the Wub, The Short Happy Life of the Brown Oxford, The Variable Man, and many others.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Gyv9wAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:d,published:"2003-01-01",publisher:h,subtitle:c}},{id:10206,attributes:{title:"Beyond Lies The Wub",description:"Peterson, a crew member from a spaceship visiting Mars, purchases a giant, pig-like creature called a wub. Although Captain Franco means to make a meal of the strange beast, the wub proves to be likeable and intelligent by discussing the travels of Odysseus and the impact of myth on the human spirit. Philip K. Dick was an American science-fiction novelist, short-story writer and essayist. His first short story, “Beyond Lies the Wub,” was published shortly after his high school graduation. Some of his most famous short stories were adapted for film, including “The Minority Report,” “Paycheck,” “Second Variety” (adapted into the film Screamers) and “We Can Remember It for You Wholesale” (adapted into the film Total Recall). HarperCollins brings great works of literature to life in digital format, upholding the highest standards in ebook production and celebrating reading in all its forms. Look for more titles in the HarperCollins short-stories collection to build your digital library.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=r1W6LypkHwgC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:"2013-04-02",publisher:"Harper Collins",subtitle:"Short Story"}},{id:10207,attributes:{title:"The Minority Report",description:"A collection of eighteen science fiction short stories features \"The Minority Report,\" in which Commissioner John Anderton's clever use of \"precogs,\" people who can identify criminals before they can do any harm, turns against him when they identify him as the next criminal.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=ODVLEAAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:d,published:i,publisher:c,subtitle:"And Other Classic Stories"}},{id:10208,attributes:{title:"The Philip K. Dick Reader",description:"Includes the stories that inspired the movies Total Recall, Screamers, Minority Report, Paycheck, and Next \"More than anyone else in the field, Mr. Dick really puts you inside people's minds.\" --The Wall Street Journal The Philip K. Dick Reader Many thousands of readers consider Philip K. Dick the greatest science fiction mind on any planet. Since his untimely death in 1982, interest in Dick's works has continued to mount, and his reputation has been further enhanced by a growing body of critical attention. The Philip K. Dick Award is now given annually to a distinguished work of science fiction, and the Philip K. Dick Society is devoted to the study and promulgation of his works. Dick won the prestigious Hugo Award for the best novel of 1963 for The Man in the High Castle. In the last year of his life, the film Blade Runner was made from his novel Do Androids Dream of Electric Sheep? This collection includes some of Dick's earliest short and medium-length fiction, including We Can Remember It for You Wholesale (the story that inspired the motion picture Total Recall), Second Variety (which inspired the motion picture Screamers), Paycheck, The Minority Report, and twenty more.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=bDVLEAAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:d,published:i,publisher:h,subtitle:c}}]}}},meta:{}}},prerenderedAt:1681377258304}}("Philip K. Dick","movie","",null,"series",1,"Paycheck","Citadel Press","2016-01-01"))